@jacobandco together with Bugatti wanted to create a true engine on the wrist that represented the powerful W16 engine. After almost a full year of development they created the Bugatti Chiron Tourbillon, a true engine on the wrist.

The Rose Gold Bugatti Chiron Tourbillon Baguette White Diamonds has over 17.80 carats of baguette diamonds and 72 baguette blue sapphires. 

Once again @jacobandco shows their phenomenal watchmaking skills using 578 working compents in this masterpiece.
